import React from 'react';
import './css/friends.css';

const Friends = () => {
    return (
        <div>
            <section>
                <div className='contatos'>
                    <div className='select amigos'>Amigos</div>
                    <div className='select nitro'>Nitro</div>
                </div>

                <div className='status'>

                </div>
            </section>
        </div>
    )
}

export default Friends;
